	float[] forestVariations;
	float[] elevations;
	float[] elevationVariations;
	
	
	private EnumButterflySpawn(int index, EnumButterflyRarity[]rarities, float[] rainfalls, float[] rainfallVariations, float[] temperatures, float[] temperatureVariations, float[] forests, float[] forestVariations, float[] elevations, float[] elevationVariations) {
		this.index = index;
		this.rarities = rarities;
		this.rainfalls = rainfalls;
		this.rainfallVariations = rainfallVariations;
		this.temperatures = temperatures;
		this.temperatureVariations = temperatureVariations;
		this.forests = forests;
		this.forestVariations = forestVariations;
		this.elevations = elevations;
		this.elevationVariations = elevationVariations;
	}
	
	
	static int[] indices;
	static {
		indices = new int[values().length];
		for (int i = 0; i < indices.length; i++) {
			indices[i] = i;
		}
	}
	
	public static int getRandomButterfly(int rainfall, int temperature, int forest, int elevation, Random random) {
		shuffle(random, indices);
		
		//System.out.println(values().length);
		
		EnumButterflySpawn[] spawns = values();
		
		for (int i = 0; i < indices.length; i++) {
			EnumButterflySpawn spawn = spawns[indices[i]];
			
			//System.out.println(i + " => " + indices[i]);
			
			for (int j = 0; j < spawn.rarities.length; j++) {
				EnumButterflyRarity rarity = spawn.rarities[j];
				
				float distance = 
					Math.abs((spawn.rainfalls[j] - rainfall) / 30f) / (1 + spawn.rainfallVariations[j]) +
					Math.abs((spawn.temperatures[j] - temperature) / 255f) / (1 + spawn.temperatureVariations[j]) +
					Math.abs((spawn.forests[j] - forest) / 255f) / (1 + spawn.forestVariations[j]) +
					Math.abs((spawn.elevations[j] - elevation) / 256f) / (1 + spawn.elevationVariations[j]) 
				;
				
				
				if (distance > 3) continue;
				
				distance *= distance;
				
				if (random.nextFloat() < (0.25f / distance) * (rarity.chance*rarity.chance)) {
					return spawn.index;
				}
				
			}
		}
		
		return 0;
	}

	
    static void shuffle(Random rand, int[] randomizedNumbers2) {
    	int tmp, rnd;
		for(int i = 0; i < randomizedNumbers2.length; i++) {
			tmp = randomizedNumbers2[i];
			rnd = rand.nextInt(randomizedNumbers2.length);
			randomizedNumbers2[i] = randomizedNumbers2[rnd];
			randomizedNumbers2[rnd] = tmp;
		}
	}

	
	
